item.description:
 &lt;h1 id=&#34;正文&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#正文&#34;&gt;#&lt;/a&gt; 正文&lt;/h1&gt;
&lt;p&gt;首先要明白几个重要的点&lt;/p&gt;
&lt;h2 id=&#34;iat表的填写&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#iat表的填写&#34;&gt;#&lt;/a&gt; IAT 表的填写&lt;/h2&gt;
&lt;p&gt;IAT 表和 INT 表都指向的是函数名称所在的位置，然后在运行的时候，IAT 表中的内容会被替换成对应函数的地址，在调用的时候使用间接 CALL ，来调用其中所储存的地址。&lt;/p&gt;
&lt;p&gt;那么操作系统又是根据什么来填写的？&lt;/p&gt;
&lt;p&gt;首先操作系统会通过 &lt;code&gt;Name&lt;/code&gt;  字段找到当前导入表的名字，然后调用 &lt;code&gt;LoadLibrary&lt;/code&gt;  得到句柄，如果没有找到的话会提示找不到 dll 文件，报错情况如下&lt;/p&gt;
&lt;p&gt;&lt;img data-src=&#34;image001.png&#34; alt=&#34;&#34; /&gt;&lt;/p&gt;
&lt;p&gt;接着会根据 &lt;code&gt;OriginalFirstThunk&lt;/code&gt;  找名字， &lt;code&gt;OriginalFirstThunk&lt;/code&gt;  所指向的也就是咱们前面所说的 INT 表，通过 INT 表中的 RVA 地址来找函数的名字。&lt;/p&gt;
&lt;p&gt;当然，这里也不一定存储的就是名字，也可能是导出序号，如果是导出序号的话，就会直接调用  &lt;code&gt;GetProcAddress&lt;/code&gt;  得到函数地址，然后填写到  &lt;code&gt;FirstThunk&lt;/code&gt;  所指向的对应位置，也就是 IAT 表中的对应位置。&lt;/p&gt;
&lt;p&gt;如果存储的是名字的话，也就是指向了 &lt;code&gt;_IMAGE_IMPORT_BY_NAME&lt;/code&gt;  结构，跳过第一个的 &lt;code&gt;Hint&lt;/code&gt;  字节，就得到了调用函数的名字，接着还是调用 &lt;code&gt;GetProcAddress&lt;/code&gt;  得到函数地址，填写到对应的位置。&lt;/p&gt;
&lt;p&gt;如果 &lt;code&gt;GetProcAddress&lt;/code&gt;  函数没有找到的话，会报如下的错误&lt;/p&gt;
&lt;p&gt;&lt;img data-src=&#34;image002.png&#34; alt=&#34;&#34; /&gt;&lt;/p&gt;
&lt;p&gt;前面一直在说，填写到对应的位置，是在说 INT 表和 IAT 表的对应关系，在 INT 表中处于第一项，对应的填写到 IAT 表的时候，也是填写到第一项的位置。&lt;/p&gt;
&lt;h2 id=&#34;iat-hook的实现&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#iat-hook的实现&#34;&gt;#&lt;/a&gt; IAT HOOK 的实现&lt;/h2&gt;
&lt;p&gt;&lt;code&gt;GetModuleHandle&lt;/code&gt;  获取本模块基址 --&amp;gt;&amp;gt; 查找导入表 --&amp;gt;&amp;gt; 遍历 IAT 表 --&amp;gt;&amp;gt; 找到要 HOOK 的函数地址 --&amp;gt;&amp;gt; 修改其页属性 --&amp;gt;&amp;gt; 修改函数地址使其跳转 --&amp;gt;&amp;gt; 恢复 HOOK？&lt;/p&gt;
&lt;h2 id=&#34;iat-hook的缺点&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#iat-hook的缺点&#34;&gt;#&lt;/a&gt; IAT HOOK 的缺点&lt;/h2&gt;
&lt;ul&gt;
&lt;li&gt;容易被检测到&lt;/li&gt;
&lt;li&gt;只能 HOOK IAT 表里的函数&lt;/li&gt;
&lt;/ul&gt;
&lt;h3 id=&#34;代码实现&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#代码实现&#34;&gt;#&lt;/a&gt; 代码实现&lt;/h3&gt;
&lt;p&gt;首先我尝试了编写 ShellCode 实现 IAT HOOK…… 因为基础差，有很多地方都卡住了。代码也有问题…… 暂时先如此了。&lt;/p&gt;
&lt;p&gt;编写 HOOK 后执行的函数，以这个函数地址替换 IAT 表中 MessageBox 的地址，写成 ShellCode，并再编写一个函数，在这个函数要更改 IAT 表中 MessageBox 的地址，还要开辟一块内存，把 HOOK 后执行的函数的 ShellCode 写入这块内存中，用以替换 IAT 表中 MessageBox 的地址。&lt;/p&gt;
&lt;ol&gt;
&lt;li&gt;首先要有一个 HOOK 后执行的函数，以这个函数地址替换 IAT 表中 MessageBox 的地址&lt;/li&gt;
&lt;/ol&gt;
&lt;p&gt;这个函数也要编写成 ShellCode&lt;/p&gt;
